  `func_id` varchar(64) DEFAULT NULL,
  `store_id` varchar(64) DEFAULT NULL,
  `tx_code` varchar(8) DEFAULT NULL,
  `tx_time` varchar(32) DEFAULT NULL,
  `user_id` varchar(32) DEFAULT NULL,
  `device_id` varchar(64) DEFAULT NULL,
  `merchant_id` varchar(64) DEFAULT NULL,
  `order_no` varchar(32) DEFAULT NULL,
  `order_req_no` varchar(32) DEFAULT NULL,
  `order_date` varchar(32) DEFAULT NULL,
  `our_trans_no` varchar(32) DEFAULT NULL,
  `amount` decimal(32,4) DEFAULT '0.0000',
  `trans_status` varchar(8) DEFAULT NULL,
  `refund_flag` varchar(8) DEFAULT NULL,
  `customer_id` varchar(64) DEFAULT NULL,
  `pay_time` datetime DEFAULT NULL,
  `create_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`pk`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

